import Head from 'next/head'
import Container from '../components/Container'

const Index=()=>{
    return (
        <div>
        <Head>
            <title>Next.js ProJects - Home</title>
        </Head>
        <Container>
                <h1>Hello world Orlando Welcome Next JS!!!:)</h1>
        </Container>  
        </div>    
    )
}

export default Index;
